        // Función para generar las tarjetas de anime
        function generarTarjetas() {
            const animeList = document.getElementById('anime-list');
            // Limpiar el contenedor antes de generar nuevas tarjetas
   
            animes.forEach(anime => {
             
             
         
     
                // Crear la tarjeta
                const card = document.createElement('div');
                card.classList.add('anime-card');

                // Crear la imagen
                const img = document.createElement('img');
                img.src = anime.imagen;
                img.alt = anime.nombre;

                // Crear la sección de información
                const info = document.createElement('div');
                info.classList.add('anime-info');

                // Añadir el nombre del anime
                const nombre = document.createElement('h3');
                nombre.textContent = anime.nombre;

                // Añadir los géneros
                const generos = document.createElement('p');
                generos.classList.add('genres');
                generos.textContent = anime.generos.join(", ");

                // Añadir la fecha
                const fecha = document.createElement('p');
                fecha.textContent = `Fecha: ${anime.fecha}`;
                
                //añadir estado 
                const estado = document.createElement('p');
                estado.textContent = anime.estado;
                //añadir episodios 
              const episodios = document.createElement('de');
                episodios.textContent = anime.episodios;
                

                // Añadir el rating (calificación con estrellas)
                const rating = document.createElement('p');
                rating.classList.add('rating');
                rating.textContent = '⭐'.repeat(anime.rating);

                // Añadir los elementos al contenedor de información
                info.appendChild(nombre);
                info.appendChild(generos);
                info.appendChild(fecha);
                info.appendChild(estado);
                info.appendChild(episodios);
                info.appendChild(rating);

                // Añadir la imagen y la información a la tarjeta
                card.appendChild(img);
                card.appendChild(info);

                // Añadir la tarjeta al contenedor principal
                animeList.appendChild(card);
            });
        }
        
     
    

        // Llamar a la función al cargar la página
        window.onload = generarTarjetas;
document.addEventListener('DOMContentLoaded', function() {
    document.getElementById('search-input').addEventListener('input', function() {
        const searchTerm = this.value.toLowerCase();
        const animeCards = document.querySelectorAll('.anime-card');

        animeCards.forEach(card => {
            const animeTitle = card.querySelector('.genres').textContent.toLowerCase();  // Selecciona el <h3>
            if (animeTitle.includes(searchTerm)) {
                card.style.display = 'block';
            } else {
                card.style.display = 'none';
            }
        });
    });
});